import React from 'react';
import { UpperHalf, Headline, PickarLogoWhite } from './styles';



export default function Board() {
    return (

        <UpperHalf>
            <div>
                <PickarLogoWhite>
                    pickar
            </PickarLogoWhite>
            </div>
            <div>
                <Headline>
                    Convert currencies in real-time.
            </Headline>
            </div>
        </UpperHalf>

    )
}
